------------------------------ */
.shura-carousel {
  width: 100%;
  overflow: hidden;
  border-radius: 6px;
  margin-bottom: 20px;
}

.shura-carousel .carousel-track {
  display: flex;
  width: calc(300px * 2);
  animation: shura-slide 15s infinite;
}

.shura-carousel .slide {
  width: 300px;
}

.shura-carousel .slide img {
  width: 100%;
  border-radius: 6px;
}

@keyframes shura-slide {
  0%   { transform: translateX(0); }
  50%  { transform: translateX(-300px); }
  100% { transform: translateX(0); }
}


/* ------------------------------
   CYBER SLOT MACHINE (asli)
------------------------------ */

@import url('https://fonts.googleapis.com/css2?family=Orbitron:wght@700&display=swap');

.cyber-slot-wrapper,
.shura-slot {
  text-align: center;
  display: flex;
  justify-content: center;
  margin-top: 25px;
}

.cyber-slot-machine {
  background: linear-gradient(145deg, #311c1c, #36138b);
  border-radius: 20px;
  padding: 30px 20px;
  width: 420px;
  box-shadow: 0 0 25px rgb(189 189 97 / 40%), inset 0 0 20px #2e17ad;
  border: 2px solid #9d2abb;
  position: relative;
  overflow: hidden;
}

.cyber-slot-title {
  color: #32d916;
  margin-bottom: 20px;
  letter-spacing: 2px;
}

.cyber-reels {
  display: flex;
  justify-content: center;
  gap: 10px;
  background: radial-gradient(circle at center, #272a0c, #32d916);
  border-radius: 12px;
  padding: 15px;
}

.cyber-reel {
  width: 100px;
  height: 110px;
  background: radial-gradient(circle at 30% 30%, #ffffff, #ffffff);
  border-radius: 12px;
  font-size: 42px;
  font-weight: bold;
  display: flex;
  justify-content: center;
  align-items: center;
}

.cyber-spin-btn {
  margin-top: 20px;
  background: linear-gradient(to right, #ffffff, #ffffff);
  border: none;
  padding: 12px 35px;
  border-radius: 18px;
  font-weight: bold;
}

.cyber-result {
  margin-top: 18px;
  color: #32d916;
  font-size: 18px;
}


/* Shine Effect */
.cyber-slot-machine::before {
  content: "";
  position: absolute;
  top: 0; left: -150%;
  width: 50%;
  height: 100%;
  background: linear-gradient(120deg,
    rgba(255,255,255,0) 0%,
    rgba(255,255,255,0.4) 50%,
    rgba(255,255,255,0) 100%);
  animation: shineSlot 3s infinite;
  transform: skewX(-20deg);
}

@keyframes shineSlot {
  0% { left: -150%; }
  100% { left: 150%; }
}
</style>


