<style>
  .RTP SLOT777-section {
    max-width: 1200px; /* lebih besar dan landscape */
    margin: 40px auto;
    padding: 50px;
    border-radius: 18px;
    background: #141e2b;
    border: 2px solid #9d2abb;
    box-shadow: 0 0 25px rgba(0, 255, 191, 0.3);
    font-family: "Poppins", sans-serif;
    color: #141e2b;
    position: relative;
    overflow: hidden;
  }

  .RTP SLOT777-section h2 {
    text-align: center;
    font-size: 32px;
    color: #32d916;
    text-shadow: 0 0 6px rgb(14, 255, 175);
    margin-bottom: 30px;
    letter-spacing: 1px;
  }

  /* FAQ */
  .RTP SLOT777-faq {
    max-width: 950px;
    margin: 0 auto 50px;
  }

  .RTP SLOT777-section details {
    background: #ffffff;
    border-radius: 12px;
    margin-bottom: 16px;
    padding: 18px 22px;
    border: 1px solid #32d916;
    transition: 0.3s ease;
  }

  .RTP SLOT777-section details:hover {
    box-shadow: 0 0 14px #ffffff;
    transform: translateY(-2px);
  }

  .RTP SLOT777-section summary {
    cursor: pointer;
    font-size: 18px;
    font-weight: 600;
    color: #141e2b;
  }

  .RTP SLOT777-section details p {
    margin-top: 12px;
    font-size: 16px;
    line-height: 1.7;
  }

  /* Testimoni */
  .testimoni-wrapper {
    display: grid;
    grid-template-columns: 1fr 1fr; /* landscape, 2 kolom */
    gap: 25px;
    margin-top: 40px;
  }

  .RTP SLOT777-section blockquote {
    background: #ffffff;
    border-left: 5px solid #32d916;
    border-radius: 12px;
    padding: 22px 26px;
    min-height: 160px;
    position: relative;
    box-shadow: 0 0 14px rgba(255, 238, 2, 0.2);
    transition: 0.3s;
  }

  .RTP SLOT777-section blockquote:hover {
    transform: translateY(-4px);
    box-shadow: 0 0 20px rgba(0, 0, 0, 0.5);
